import React, { Component } from 'react'
import ProjectPost from './model/ProjectPost'
import projectData from './data/projects'

export default class Project extends Component {
  render() {

    const projectComponent = projectData.map(project =>
      <ProjectPost key={projectData.id} title={projectData.title}
      language={projectData.language} description={projectData.description}
      repository={projectData.repository}/>)

    return (
      <div>
        {projectComponent}
      </div>
    )
  }
}
